text_huifu2={'泗洲发展靠大家，关注需要您-我-他，关注泗洲一路有您！','您好！关注《泗洲快讯》，我们将为您第一时间分享泗洲事。','关注《泗洲快讯》，您将第一时间了解泗县实情，愿你健康快乐！感谢微信有您！','愿你健康快乐！感谢微信有你！关注泗洲快讯，无论你身在哪里，都可以第一时间了解泗洲实情。','《泗洲快讯》每天时时播报泗县最新事，您值得关注！','泗洲人，泗洲事，尽在《泗洲快讯》，天天播报，无论你身在何处，家乡发展总是离不开您的时刻关注，泗洲有您更美好。','一花一草皆生命，一枝一叶总关情，时时关注泗洲发展，感谢有您的参与！','了解泗县人，关注泗洲事，从您我他做起，感谢有您关注《泗洲快讯》！'}
